Prime Factorization of 100:  
\begin{align*}
100 &= 2 * 50\\
&= 2*2*25 \\
&= 2*2*5*5\\
&= 2^2 * 5^2
\end{align*}

Prime Factorization of 150:  
\begin{align*}
150 &= 2 * 75\\
&= 2 * 3 * 25\\
&= 2*3*5*5\\
&= 2*3*5^2
\end{align*}

Now take out the lowest power among each pair of same exponents so you get the HCF as followings;   
\begin{align*}
hcf_{100,150} &= min(a^{b},c^{d})\\
&=(2^{min(2,1)})*(5^{min(2,2)})\\
&=2^1*5^2=50 
\end{align*}
